  and marine toxic substances and pollutants collected using net and sediment samplers
  from the MT MITCHELL and other platforms from 22 May 1974 to 27 May 1974 (NODC Accession
  7800886)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-09-26T23:12:22.683302\",\n\t\"name\":
  \"benthic-organisms-and-marine-toxic-substances-and-pollutants-collected-using-net-and-sediment-s\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic organisms and marine toxic substances
  and pollutants were collected using sediment sampler and net casts in the coastal
  waters of the East coast of US. Data were submitted by Dr. J.C. Ayres of the Marine
  Fisheries Service in Highlands. Data were collected from 22 May 1974 to 27 May 1974.
  Data has been been processed by NODC to the NODC standard F132- Benthic Organisms
  and F144- Marine Toxic Substances and Pollutants formats. Full format and format
  code descriptions are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe
  F132 format contains data from field sampling or surveys of bottom dwelling marine
  organisms. The data provide information on species abundance, distribution, and
  biomass; they may have been collected by point sampling (grab or core), by tow (dredge,
  trawl or net), by photographic surveys, or by other methods. Cruise information
  such as vessel, start and end dates, investigator, and institution/agency; station
  numbers, positions and times; and equipment and methods are reported for each survey.
  Environmental data reported at each sampling site may include meteorological and
  sea surface conditions; surface and bottom temperature, salinity and dissolved oxygen;
  and sediment characteristics. Number of individual organisms and total weight of
  organisms is reported for each species. A text record is available for comments.nnThe
  F144 format contains data on ambient concentrations of toxic substances and other
  pollutants in the marine environment. The data derive from laboratory analyses of
  samples of water, sediment, or marine organisms. Samples may have been collected
  near marine discharge sites or during ocean monitoring surveys of large areas. Field
  observations of tar deposits on beaches may also be reported. Survey information
  includes platform type, start and end dates, and investigator and institution. If
  data are collected near a discharge site, discharge location, depth, distance to
  shore, average volume, and other characteristics are reported. Position, date, time
  and environmental conditions are reported for each sample station. Environmental
  data may include meteorological and sea surface conditions, tide stage and height,
  depth of the thermocline or mixed layer surface temperature and salinity, and wave
  height and periods. Sample characteristics, collection methods, and laboratory techniques
  are reported for each sample collected and analyzed. The data record comprises concentration
  values (or a code to indicate trace amounts) for each chemical substance analyzed.
  Chemical substances are identified by codes based on the registry numbers assigned
  by the Chemical Abstracts Service (CAS) of the American Chemical Society. Marine
  organisms from which samples have been taken are identified using the 12-digit NODC
  Taxonomic Code. A text record is available for optional comments.\",\n\t\"license_title\":
